        <input   className="nav-bar"type="search"   style={"width: 300px; height: 150px"}/>
        <h3 className="nav-bar">Bookmarked</h3>
        <h3 className="nav-bar">Caterogies</h3>
        



    </nav>

    )
}

export default NavBar;
